<Hungarian>:
A szövetségesek és a tengelyhatalmak csapnak össze az ország északi részén fekvő tengerparti terület megszerzéséért.

A légierő céljai:
– semmisítsd meg az ellenséges repülőgépeket;
– védd meg a szárazföldi erőket;
– bombázd le az ellenség bázisait.

A szárazföldi erők céljai:
– semmisítsd meg az ellenséges harckocsikat;
– foglald el és tartsd meg a stratégiai pontokat.

[Hadművelet] játékmódban a csapatoknak különféle feladatokat kell teljesíteniük a győzelem érdekében.

A küldetés céljai:
– semmisítsd meg a megjelölt szárazföldi célpontokat;
– semmisítsd meg az ellenség bázisait;
– semmisítsd meg az ellenség repülőterét.

[Frontvonal] játékmódban a csapatoknak különféle feladatokat kell teljesíteniük a frontvonalnál a győzelem érdekében.

A küldetés céljai:
– semmisítsd meg a megjelölt szárazföldi célpontokat;
– semmisítsd meg az ellenség bázisait;
– semmisítsd meg az ellenség repülőterét.
